jQuery(document).ready(function($){var WPDF_Form={init:function(){this.run()},get_plugins:function(){return wpdf_settings.plugins},get_plugin_deactivation_anchor:function(plugin){var row=jQuery('tr[data-plugin="'+plugin+'"]'),link=row.find("span.deactivate a");return link},get_plugin_deactivation_url:function(a){var href=jQuery(a).attr("href");return href},run:function(){var plugins=this.get_plugins();jQuery.each(plugins,function(i,plugin){var anchor=WPDF_Form.get_plugin_deactivation_anchor(plugin.file);WPDF_Form.get_plugin_deactivation_url(anchor);jQuery(anchor).on("click",function(event){event.preventDefault()})})}};WPDF_Form.init()});